import { useState } from "react";

function App() {
  const [car, setCar] = useState({
    brand: "Ford",
    model: "Mustang",
    year: "1964",
    color: "red"
  });

  return (
    <>
      <h1>My {car.brand}</h1>
      <button type="button" onClick={()=>setCar(year="1980")}>
        It is a {car.color} {car.model} from {car.year}.
      </button>
    </>
  );
}

export default App;
